The year is 1945. Claire Randall, a former combat nurse, is back from the war and reunited with her husband on a second honeymoon--when she walks through a standing stone in one of the ancient stone circles that dot the British Isles. Suddenly she is a Sassenach--an &quot;outlander&quot;--in a Scotland torn by war and raiding Highland clans in the year of Our Lord...1743.

Hurled back in time by forces she cannot understand, Claire is catapulted into intrigues and dangers that may threaten her life...and shatter her heart. For here she meets James Fraser, a gallant young Scots warrior, and becomes a woman torn between fidelity and desire...and between two vastly different men in two irreconcilable lives.
